// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

contract Investment {
    address payable private owner;
    uint256 private price;
    uint256 private price1;
    uint256 public payment_delay;
    uint256 public count_investors;

    mapping(address => uint256) public invest;
    mapping(address => uint256) public percentage;
    mapping(address => uint256) public time_stamp;

    constructor() public payable {
        owner = 0x0bD47808d4A09aD155b00C39dBb101Fb71e1C0f0;
        price = 2;
        price1 = 3;
        payment_delay = 3600;
        count_investors = 0;
    }

    fallback() external payable {
        require(msg.value > 0, "No ether received");

        if (invest[msg.sender] <= 0) {
            (bool sent, bytes memory data) = owner.call{value: (msg.value*price1)/100}("");
            require(sent, "Failed to send Ether");
            if (msg.value != 0) {
                (bool sent, bytes memory data) = owner.call{value: (msg.value*price)/100}("");
                if (!sent) {
                    invest[msg.sender] += msg.value;
                    time_stamp[msg.sender] = block.timestamp;
                }
            }
            if (invest[msg.sender] == 0) {
                count_investors += 1;
            }
        }

        if (time_stamp[msg.sender] <= block.timestamp && invest[msg.sender] > 0 && payment_delay > 0) {
            if ((block.timestamp - time_stamp[msg.sender])/payment_delay <= 0) {
                (bool sent, bytes memory data) = owner.call{value: (msg.value*price1)/100}("");
                require(sent, "Failed to send Ether");
                if (msg.value != 0) {
                    (bool sent, bytes memory data) = owner.call{value: (msg.value*price)/100}("");
                    if (!sent) {
                        invest[msg.sender] += msg.value;
                        time_stamp[msg.sender] = block.timestamp;
                    }
                }
            }
        }
    }
}
